import React from "react";
import "./App.css";


/*function MovieCard(props) {
    const { movie } = props;

    return (
        <div classame={`show-container ${movie.title}`} />
    )
}

export default MovieCard;*/

const MovieCard = ({ title, year, duration, genre, score }) => {
    if (!title) return <div />;
    return (
      <table>
        <tbody>
          <tr>
            <td>
              <h5>{title}</h5>
            </td>
            <td>
              <h5>{year}</h5>
            </td>
            <td>
              <h4>{duration}</h4>
            </td>
            <td>
              <h4>{score}</h4>
            </td>
            <td>
              <p>{genre}</p>
            </td>
            <td>
              <p>{score}</p>
            </td>
          </tr>
        </tbody>
      </table>
    );
  };
